import React from 'react';
import Styles from './register.css';
import ReactDOMServer from 'react-dom/server';
import { Redirect } from 'react-router-dom';

class Register extends React.Component {
  constructor(props){
    super(props);
    };


  render(){
    return (
        <div class="background">
            <div class="container">
                <form>
                    <div class="form-group emailinput">
                        <input type="email" class="form-control emailInput" id="exampleInputEmail1" aria-describedby="emailHelp" placeholder="Email"/>
                    </div>
                    <div class="form-group passInput">
                        <input  type="password" class="form-control passInput" id="exampleInputPassword1" placeholder="Password"/>
                    </div>
                        <button type="button" class="btn btn-primary loginButton">Sign in</button>
                </form>
            </div>
        </div>
    );
  }
}



export default Register;
